function Card(props)
{
    q =props.q
    i=props.i
    setI = props.setI
    return(
        Array(q[i]).map((elem)=>{
            return(
              <>
              <h1>{elem.q}</h1>
              <ul>
               { elem.rep.map((e)=>{
                  return(
                    <li onClick={()=>setI(i+1)}>{e.r}</li>
                  )
                })
              }
              </ul>
           </> )
          })
    
    );
    

}

export default Card;
